    t[3534] = "The ratio of tunnel hops we provide to tunnel hops we use - a value greater than 1.00 indicates a positive contribution to the network";
    t[3535] = "Az \u00e1ltalunk biztos\u00edtott alag\u00fat ugr\u00e1sok ar\u00e1nya az \u00e1ltalunk haszn\u00e1lt alag\u00fat ugr\u00e1sokhoz - az 1.00-n\u00e1l nagyobb \u00e9rt\u00e9k a h\u00e1l\u00f3zathoz val\u00f3 pozit\u00edv hozz\u00e1j\u00e1rul\u00e1st jelent";
