    t[3546] = "Updated bandwidth limits";
    t[3547] = "S\u00e1vsz\u00e9less\u00e9g korl\u00e1tai friss\u00edtve";
    t[3552] = "Version {0}";
    t[3553] = "{0} Verzi\u00f3";
    t[3554] = "You may notice a message in the sidebar that I2P is rejecting tunnels.";
    t[3555] = "Lehet, hogy felt\u0171nik az \u00fczenet az oldals\u00e1vban, hogy az I2P alagutakat utas\u00edt el.";
    t[3558] = "Otherwise, you may need to reseed your I2P router. Visit the <a href=\"/configreseed#reseedconfig\">Reseed Configuration page</a> and click the \"Save Changes and Reseed Now\" button.";
    t[3559] = "K\u00fcl\u00f6nben lehet, hogy \u00fajra kell t\u00e1pl\u00e1lnod az I2P routered. L\u00e1togass el a <a href=\"/configreseed#reseedconfig\">\u00dajrat\u00e1pl\u00e1l\u00e1s Be\u00e1ll\u00edt\u00e1sai oldalra</a> \u00e9s kattints a \"V\u00e1ltoztat\u00e1sok Ment\u00e9se \u00e9s \u00dajrat\u00e1pl\u00e1l\u00e1s Most\" gombra.";
    t[3560] = "You must enter a key";
    t[3561] = "Kulcs megad\u00e1sa sz\u00fcks\u00e9ges";
    t[3562] = "To override these limits, add the settings i2np.ntcp.maxConnections=nnn and i2np.udp.maxConnections=nnn on the advanced configuration page.";
    t[3563] = "E hat\u00e1rok fel\u00fcl\u00edr\u00e1s\u00e1hoz a k\u00f6vetkez\u0151 be\u00e1ll\u00edt\u00e1sokat a halad\u00f3 be\u00e1llit\u00e1sok oldalon: i2np.ntcp.maxConnections=nnn \u00e9s i2np.udp.maxConnections=nnn .";
    t[3566] = "A graceful restart will take a few minutes (but your peers will appreciate your patience), while a hard restart does so immediately.";
    t[3567] = "A t\u00fcrelmes \u00fajraind\u00edt\u00e1s beletelik n\u00e9h\u00e1ny percbe (viszont a t\u00e1rsak \u00e9rt\u00e9kelni fogj\u00e1k t\u00fcrelmedet), m\u00edg az er\u0151s \u00fajraind\u00edt\u00e1s azonnal megt\u00f6rt\u00e9nik.";
    t[3568] = "Error saving the configuration (applied but not saved) - please see the error logs";
    t[3569] = "Hiba a be\u00e1ll\u00edt\u00e1sok ment\u00e9sekor (alkalmazva de nincs mentve) - k\u00e9rlek, vizsg\u00e1ld meg a hibanapl\u00f3t";
    t[3570] = "Changing these settings will restart your router.";
    t[3571] = "Ezeknek a be\u00e1ll\u00edt\u00e1soknak a megv\u00e1ltoztat\u00e1sa \u00fajra fogja ind\u00edtani a router-t.";
